INSERT INTO `customer_about_pages` (`ID`, `PageTitle`, `PageText`, `Publish`) VALUES
(1, 'About ABC Jewellers', '%3Cdiv%3EOur+great+grandfather+has+started+Gold+business+in+1950+with+the+name+of+%3Cb%3EA+B+C%3C%2Fb%3E%26nbsp%3Bin+small+town+near+%3Ci%3EVadodara%3C%2Fi%3E+called+%3Ci%3ESinor%3C%2Fi%3E.+After+that+father+and+other+family+member+has+continue+worked+in+Gold+business+with+different+level+and+different+name.%3C%2Fdiv%3E', 'Yes'),
(2, 'About ABC Jewellers', 'Associated+with+Gold+business+since+1950%2C+our+great+grandfather+has+started+Gold+business+with+the+name+of+%3Cb%3EA+B+C+%3C%2Fb%3Ein+small+town+near+%3Ci%3EVadodara%3C%2Fi%3E+called+%3Ci%3ESinor%3C%2Fi%3E.+After+that+father+and+other+family+member+has+continue+worked+in+Gold+business+with+different+level+and+different+name.+We+have+restarted+Gold%2F+Diamond%2F+Silver+business+with+the+same+name+%3Cb%3EA+B+C%3C%2Fb%3E+from+last+one+year.+Now%2C+we+bring+for+you%2C+our+online+jewellery+store+%3Ca+href%3D%22http%3A%2F%2Fwww.abc.com%22+title%3D%22Link%3A+http%3A%2F%2Fwww.abc.com%22%3E%3Cb%3Ewww.abc.com%3C%2Fb%3E%3C%2Fa%3E+that+aims+to+have+more+designs+to+choose+from.+One+destination+to+form+your+any+day+a+special+occasion.', 'Yes'),
(3, 'Our Vision', 'Our+Vision+is+to+avail+online+jewellery+with+none+problem+in+your+required+and+budgeted+value.+Hundreds+of+jewellery+styles+can+provide+you+with+the+selection+to+pick+out+and+order+online.+You%E2%80%99ll+receive+your+jewellery+at+the+doorstep+in+shortest+doable+time.', 'Yes'),
(4, 'Manifesto', 'Latest+Equiste+Style%2C+Finest+Gems+and+Quality+Acquisition+are+3+pillars+of+%3Cb%3EA+B+C%3C%2Fb%3E.+These+are+more+supported+by+customized+service+and+Quality+Assurance.+%3Cb%3EA+B+C%3C%2Fb%3E+has+continuously+understood+that+jewellery+is+a+very+personal+affair+for+a+lady.+A+woman%E2%80%99s+heart+sings+and+dances+with+the+shine+%26amp%3Bamp%3B+glitter+of+her+jewels.+Thus+we+tend+to+take+utmost+care+in+each+side+of+full+filling+a+woman%E2%80%99s+need+for+the+best+jewels.', 'Yes');
