INSERT INTO `customer_services_pages` (`ID`, `PageTitle`, `PageText`, `Publish`) VALUES
(1, 'Shipping Policy', '%3Cul%3E%3Cli%3EWe+strive+to+deliver+your+orders+on+time.Customers+would+be+intimated+incase+of+unforeseen+delays.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EAll+products+sold+on+abc.com+are+shipped+free+of+cost+to+all+locations+across+India.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EOur+shipping+partners+are+top+shipping+experts+like+Sequel%2C+BVC+Logistices%2C+DHL-Bluedart%2C+DTDC+%26amp%3B+others+that+are+cardinal+in+customer+commitment.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EWe+ship+our+products+all+across+India.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EAll+the+products+are+custom+made+by+abc.com+in+collaboration+goldsmiths.+They+are+hallmarked+and+certified+by+the+top+jewellery+certifying+laboratories+of+the+world+viz.+GIA+%28Gemological+Institute+of+America%29%2C+IGI+%28International+Gemological+Institute%29%2C+SGL+%28Solitaire+Gemological+Laboratories%29%2C+EGL+%28European+Gemological+Laboratory%29+or+HKD+%28HKD+Diamond+Laboratories+-+Canada%29.+Hence%2C+the+products+would+take+upto+14+working+days+to+be+dispatched%2C+after+all+the+payments+are+cleared.+International+shipping+may+take+more+than+14+days+due+to+the+customs+processing.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EProducts+will+only+be+shipped+after+receiving+the+complete+payment+against+the+order.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EFor+security+reasons%2C+all+orders+would+require+signature+upon+delivery%2C+regardless+of+any+signature+waiver+on+file.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EFor+security+reasons%2C+merchandise+orders+over+Rs.+10%2C000+cannot+be+shipped+to+an+address+other+than+the+billing+address+associated+with+your+method+of+payment.+However+if+it+is+required+to+do+so%2C+a+valid+authorization+from+the+customer+is+mandatory.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EFor+the+purchase+of+all+gold+coins%2Fbars%2C+the+name+on+the+card+used+for+making+payment%2C+photo+ID+of+the+cardholder%26amp%3B+the+buyers+name+mentioned+in+order%2C+should+be+the+same.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EA+photo+ID+%28soft+copy%29+would+be+required+to+be+sent+to+us+for+the+purchase+of+all+gold+coins%2Fbars.+The+order+will+be+processed+only+after+Id+proof+is+received.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EHand+delivery+will+be+provided+only+for+either+residence+address+or+office+address.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3ENo+requests+will+be+taken+for+hand+delivery+for+addresses+mentioned+outside+of+residence+address+or+office+address.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EIn+case+a+card+that+does+not+belong+to+the+purchaser%2C+has+been+used+to+make+payment%2C+the+photo+ID+of+both+the+card+holder+and+the+non-card+holder+will+have+to+be+submitted.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EFor+any+customer+request+that+entails+handing+over+the+parcel+or+delivery+to+a+third+person%2C+an+email+confirmation+for+the+same%2C+along+with+his%2Fher+photo+ID%2C+will+be+required+from+the+buyer+for+the+authorization+of+the+person+in+question.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EInsurance+for+the+jewellery+that+is+in+shipping+would+be+taken+care+of+by+abc.com.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EOnce+the+order+has+been+shipped%2C+the+customer+would+receive+an+e-mail+from+abc.com+containing+Fedex%2C+DHL-Bluedart%2C+and%2For+DTDC+and+any+other+courier+company+tracking+number+and+a+link+to+the+website%27s+order-tracking+page.+The+customer+can+also+check+the+status+of+the+order%2C+once+it+has+been+shipped%2C+by+visiting+the+website+of+our+logistics+partner+and+using+the+tracking+number.+Your+tracking+number+can+also+be+found+on+the+Order+Status+page+on+abc.com.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EAll+shipments+are+traceable.%3C%2Fli%3E%3C%2Ful%3E', 'Yes'),
(2, 'Refund Policy', '%3Cul%3E%3Cli%3EAll+Refunds+shall+be+processedvia+an+online+bank+transfer+to+the+customer%27s+bank+account+within+the+10+days+of+receipt+of+the+product.+If+the+mode+of+payment+is+through+online+debit%2Fcredit+cards%2Fnet+banking%2C+the+refund+will+be+processed+by+reversal+of+previous+transaction.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EIn+cases+of+refunds+under+30+days+return%2C+refund+is+subject+to+quality+confirmation+by+our+skilled+quality+assurance+team+and+verification+of+product+documents+like+insurance+certificate%2C+original+invoice+and+product+certificate.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EThe+money+back+amount+will+be+100%25+of+actual+amount+paid.+In+case%2C+any+Coupon%2C+Discount+or+Promo+Codes+were+used+during+the+original+purchase%2C+the+exchange+amount+will+be+reduced+by+an+amount+equivalent+to+the+Coupon%2C+Discount+or+Promo+Codes%2C+as+applicable.%3Cbr%3E%3Cbr%3E%3C%2Fli%3E%3Cli%3EPart+payments+received+against+customized+jewellery+are+not+refunded.%3C%2Fli%3E%3C%2Ful%3E', 'Yes'),
(3, '14-Days Return Policy', '%3Ch3%3E14-Days+Return+Policy%3C%2Fh3%3E%3Cul%3E%3Cli%3EOnly+the+products+purchased+from+the+abc.com%2C+with+supporting+documents+and+with+the+tag+%3Cb%3E%E2%80%9CNon+Returnable+If+torn%E2%80%9D%3C%2Fb%3E+intact%2C+would+be+eligible+for+return+policy.+Products+showing+signs+of+damage%2C+wear+and+tear%2C+alterations%2C+resizing+%28by+a+jeweller+other+than+abc.com%29+will+not+be+accepted+under+this+policy.%3C%2Fli%3E%3Cli%3EThe+product+is+eligible+for+an+exchange+on+abc.com+for+100%25+of+the+purchase+value+within+14+days+of+purchase.+Incase+the+value+of+the+exchanged+product+is+lower+than+the+new+product%3B+the+customer+will+have+to+pay+the+difference+between+the+value+of+the+new+and+old+product.+Incase+the+value+of+the+old+product+is+more+than+the+new+one%3B+the+difference+would+be+held+as+a+credit.+An+order+is+eligible+for+exchange+only+once+after+which+it+goes+under+Lifetime+Exchange+Policy.%3C%2Fli%3E%3Cli%3ERefund+policy+is+not+applicable+on+Tushi+necklaces%2C+but+they+can+be+exchanged.%3C%2Fli%3E%3Cli%3EProducts+found+damaged+on+receipt+or+are+different+from+the+design+shown+on+the+website%2C+would+be+eligible+for+return.+10%25+of+the+product+value+would+be+deducted+from+the+return+amount+incase+the+customer+demands+refund.%3C%2Fli%3E%3Cli%3EProducts+customized+%28designed+thought+our+bespoke+service%2C+i.e+design+customization%2C+engravings%2C+removal+of+tag%2C+logo+etc%29+as+not+eligible+for+return+or+refund.+They+are+only+eligible+for+the+Lifetime+Exchange+Policy.%3C%2Fli%3E%3Cli%3EThe+14+days+return+policy+does+not+cover+Loose+Solitaire+Diamond+%2F+Gemstones+and+Gold+Coins+or+Bars+and+Frames.%3C%2Fli%3E%3Cli%3EThis+feature+is+not+available+for+International+Orders+%28Orders+that+will+be+shipped+abroad+from+India%29.%3C%2Fli%3E%3C%2Ful%3E%3Ch3%3EHow+do+i+return+the+product+within+14+days%3F%3C%2Fh3%3E%3Cul%3E%3Cli%3EA+damaged+product+upon+delivery%2C+must+be+immediately+reported+at+our+customer+service+deskon+%3Cb%3E%2B91+0123456789%3C%2Fb%3E+or+email+us+at+%3Cb%3Econtactus%40domain.com%3C%2Fb%3E+for+assistance.%3C%2Fli%3E%3Cli%3EPlease+read+the+information+on+your+original+packing+slip.%3C%2Fli%3E%3Cli%3EThe+unused+item+must+be+secured+in+its+original+packing+and+must+be+in+its+sealed+form+with+all+accessories%2C+tags%2C+boxes%2C+bags%2C+stickers%2C+papers+and+original+invoice.%3C%2Fli%3E%3Cli%3EOur+customer+service+team+would+arrange+a+pick+up+once+we+receive+a+call+from+the+customer+for+the+same.%3C%2Fli%3E%3Cli%3ECostumers+can+also+the+return+package+to+the+address+indicated+on+the+packing+slip%3A%3Cbr%3E%3Cb%3EABC%3C%2Fb%3E%3Cbr%3EB%2F60+Zaver+Society%3Cbr%3EHarni+Ring+Road%3Cbr%3EMumbai+400028%2C+MH%2CIndia%3C%2Fli%3E%3Cli%3EKeep+the+Return+Tracking+Number+from+the+package+you+are+returning+to+ensure+that+the+package+is+returned+to+our+distribution+center+as+mentioned+above.%3C%2Fli%3E%3Cli%3EA+refund+can+be+expected+within+10-14+working+days+of+our+receiving+the+returned+product.+Refund+will+be+credited+via+the+mode+of+payment+used+for+the+original+purchase.%3C%2Fli%3E%3Cli%3EIn+case+the+product+is+damaged+on+delivery+or+a+wrong+product+isdelivered%2C+a+free+exchange+or+full+refund+for+the+merchandise+and+shipping+charges+after+a+quality+check+upon+receipt+would+be+provided.%3C%2Fli%3E%3Cli%3EAll+ABC+jewellery+comes+with+an+IGI%C2%A9%2C+GIA%C2%A9%2C+HKD%C2%A9+or+EGL%C2%A9+appraisal+certificate+and+must+be+returned+with+the+certificate.+If+the+product+is+returned+without+the+certificate%2C+a+replacement+cost+would+be+deducted+from+the+refund+amount.+To+know+the+replacement+cost%2Ckindly+let+us+know+beforehand%2C+if+the+certificate+cannot+be+returned.+abc.com+will+not+be+responsible+for+any+loss+or+damage+of+return+shipments.%3Cbr%3EIf+you+have+any+questions+about+our+return+procedure%2C+please+contact+us+at%26nbsp%3B%3Ca+target%3D%22_top%22+rel%3D%22%22%3E%3Cb%3Econtactus%40domain.com%3C%2Fb%3E%3C%2Fa%3E%3C%2Fli%3E%3C%2Ful%3E', 'Yes'),
(4, 'Cancellation Policy', '%3Ch3%3ECancellation+Policy%3C%2Fh3%3E%3Cspan%3EProducts+once+bought+can+be+cancelled+or+returned+with+24+hours+of+placing+an+order.+A+cancellation+fee+of+10%25+of+the+final+product+price+would+be+deducted+from+the+paid+amount+on+cancellation+after+24+hours.+Gold+coins%2Fbars%2C+frames%2C+customized+jewelry%2C+gift+cards+and+loose+solitaires+cannot+be+returned+or+cancelled+under+any+circumstances.+In+case+of+payment+via+EMI%2C+10%25+of+the+order+value+would+be+charged+to+the+foreclosure%2F+default+customer%2C+as+a+transaction+fee+and+the+balance+amount+would+be+refunded.%3Cbr%3E%3C%2Fspan%3E%3Cbr%3EAt+the+time+of+placing+an+order%2C+abc.com%2C+at+its+sole+discretion%2C+may+ask+for+a+percentage+of+the+value+of+transaction%2C+as+an+advance.+The+balance+amount+would+have+to+be+paid+by+the+customer+at+the+time+of+product+delivery.+The+order+might+be+considered+as+cancelled+in+case+of+failure+to+make+the+balance+payment+at+the+time+of+delivery.+Abc.com%2C+at+its+sole+discretion%2C+reserves+the+rights+to+cancel+any+particular+order.+Some+situations+that+may+result+in+the+order+being+canceled+or+refused+are+%28i%29+limitations+on+quantities+available+for+purchase%3B+and+%28ii%29+inaccuracies+or+errors+in+product+or+pricing+information.+Additional+verification+or+information+may+be+required%2C+before+accepting+any+orders.%3Cbr%3E', 'Yes'),
(5, 'Privacy Policy', '%3Ch3%3EPrivacy+Policy%3C%2Fh3%3EWe+value+the+trust+you+place+in+abc.com.+That%27s+why+we+insist+upon+the+highest+standards+for+secure+transactions+and+customer+information+privacy.%3Col%3E%3Cli%3E%3Cb%3ECollection+of+Personally+Identifiable+Information%3Cbr%3E%3C%2Fb%3EWe+collect+email+address+from+you+when+you+select+email+during+the+first+app+launch.+This+enables+us+to+sync+your+wishlist+and+shopping+cart+already+created+by+you+on+the+ABC+%28abc.com%29+website.+We+also+use+your+contact+information+to+send+you+offers+and+recommendations+based+on+your+previous+orders%2C+your+browsing+history+and+your+interests.%3Cul%3E%3Cli%3EWe+may+disclose+to+third+party+services+certain+personally+identifiable+information+listed+below%3A%3Cbr%3Einformation+you+provide+us+such+as+name%2C+email%2C+mobile+phone+number%2C+information+we+collect+as+you+access+and+use+our+service%2C+including+device+information%2C+location+and+network+carrier%3C%2Fli%3E%3Cli%3EThis+information+is+shared+with+third+party+service+providers+so+that+we+can+personalize+the+app+for+you%2C+perform+behavioral+analytics%3C%2Fli%3E%3C%2Ful%3E%3C%2Fli%3E%3Cli%3E%3Cb%3EUse+of+Demographic+and+Profile+Data%3C%2Fb%3E%3Cbr%3EWe+use+personal+information+to+provide+the+services+you+request.+We+use+your+personal+information+to+troubleshoot+problems%3B+collect+fees+owed%3B+measure+interest+in+our+products+and+services%2C+inform+you+about+online+and+offline+offers+and+customize+your+experience.+In+our+efforts+to+continually+improve+our+product+and+service+offerings%2C+we+collect+and+analyze+demographic+and+profile+data+about+our+users%27+activity+on+our+app.+We+identify+and+use+your+IP+address+to+help+diagnose+problems+with+our+server%2C+and+to+administer+our+app.%3C%2Fli%3E%3Cli%3E%3Cb%3ESecurity+Precautions%3C%2Fb%3E%3Cbr%3EOur+site+has+stringent+security+measures+in+place+to+protect+the+loss%2C+misuse%2C+and+alteration+of+the+information+under+our+control.+Whenever+you+change+or+access+your+account+information%2C+we+offer+the+use+of+a+secure+server.+Once+your+information+is+in+our+possession+we+adhere+to+strict+security+guidelines%2C+protecting+it+against+unauthorized+access.%3C%2Fli%3E%3Cli%3E%3Cb%3EChoice%2FOpt-Out%3C%2Fb%3E%3Cbr%3EAbc.com+provides+all+users+with+the+opportunity+to+opt-out+of+receiving+non-essential+%28promotional%2C+marketing-related%29+communications+from+us+on+behalf+of+our+partners%2C+and+from+us+in+general%2C+after+setting+up+an+account.%3C%2Fli%3E%3Cli%3E%3Cb%3EQuestions%3C%2Fb%3E%3Cbr%3EQuestions+regarding+this+statement+should+be+directed+to+the+following+address%3A%26nbsp%3B%3Ca+target%3D%22_top%22+rel%3D%22%22+title%3D%22Link%3A+null%22%3Econtactus%40domain.com%3C%2Fa%3E%3C%2Fli%3E%3C%2Fol%3E', 'Yes'),
(6, 'Terms & Conditions', '%3Ch3%3ETerms+%26amp%3B+Conditions%3C%2Fh3%3E%3Cdiv%3E%3Cb%3EUse+of+the+Website%3C%2Fb%3E%3Cbr%3EBy+accessing+the+website%2C+you+warrant+and+represent+to+the+website+owner+that+you+are+legally+entitled+to+do+so+and+to+make+use+of+information+made+available+via+the+website.%3Cbr%3E%3Cbr%3E%3Cb%3ETrademarks%3C%2Fb%3E%3Cbr%3EThe+trademarks%2C+names%2C+logos+and+service+marks+%28collectively+%22trademarks%22%29+displayed+on+this+website+are+registered+and+unregistered+trademarks+of+the+website+owner.+Nothing+contained+on+this+website+should+be+construed+as+granting+any+license+or+right+to+use+any+trademark+without+the+prior+written+permission+of+the+website+owner.%3Cbr%3E%3Cbr%3E%3Cb%3EExternal+Links%3C%2Fb%3E%3Cbr%3EExternal+links+may+be+provided+for+your+convenience%2C+but+they+are+beyond+the+control+of+the+website+owner+and+no+representation+is+made+as+to+their+content.Use+or+reliance+on+any+external+links+and+the+content+thereon+provided+is+at+your+own+risk.%3Cbr%3E%3Cbr%3E%3Cb%3EWarranties%3Cbr%3E%3C%2Fb%3EThe+website+owner+makes+no+warranties%2C+representations%2C+statements+or+guarantees+%28whether+express%2C+implied+in+law+or+residual%29+regarding+the+website.%3Cbr%3E%3Cbr%3E%3Cb%3EPrices%3C%2Fb%3E%3Cbr%3EOur+pricing+is+calculated+using+current+precious+metal+and+gem+prices+to+give+you+the+best+possible+value.These+prices+do+change+from+time+to+time%2C+owing+to+the+fluctuations+in+prices+of+precious+metal+and+gem+prices%2C+so+our+prices+change+as+well.Prices+on+abc.com+are+subject+to+change+without+notice.Please+expect+to+be+charged+the+price+for+the+ABC+merchandise+you+buy+as+it+is+listed+on+the+day+of+purchase.%3Cbr%3E%3Cbr%3E%3Cb%3EDisclaimer+of+Liability%3C%2Fb%3E%3Cbr%3EThe+website+owner+shall+not+be+responsible+for+and+disclaims+all+liability+for+any+loss%2C+liability%2C+damage+%28whether+direct%2C+indirect+or+consequential%29%2C+personal+injury+or+expense+of+any+nature+whatsoever+which+may+be+suffered+by+you+or+any+third+party+%28including+your+company%29%2C+as+a+result+of+or+which+may+be+attributable%2C+directly+or+indirectly%2C+to+your+access+and+use+of+the+website%2C+any+information+contained+on+the+website%2C+you+or+your+company%27s+personal+information+or+material+and+information+transmitted+over+our+system.+In+particular%2C+neither+the+website+owner+nor+any+third+party+or+data+or+content+provider+shall+be+liable+in+any+way+to+you+or+to+any+other+person%2Cfirm+or+corporation+whatsoever+for+any+loss%2C+liability%2C+damage+%28whether+direct+or+consequential%29%2C+personal+injury+or+expense+of+any+nature+whatsoever+arising+from+any+delays%2C+inaccuracies%2C+errors+in%2C+or+omission+of+any+share+price+information+or+the+transmission+thereof%2Cor+for+any+actions+taken+in+reliance+thereon+or+occasioned+thereby+or+by+reason+of+non-performance+or+interruption%2C+or+termination+thereof.We+as+a+merchant+shall+be+under+no+liability+whatsoever+in+respect+of+any+loss+or+damage+arising+directly+or+indirectly+out+of+the+decline+of+authorization+for+any+Transaction%2C+on+Account+of+the+Cardholder+having+exceeded+the+preset+limit+mutually+agreed+by+us+with+our+acquiring+bank+from+time+to+time.%3Cbr%3E%3Cbr%3E%3Cb%3EConflict+of+Terms.%3C%2Fb%3E%3Cbr%3EIf+there+is+a+conflict+or+contradiction+between+the+provisions+of+these+website+terms+and+conditions+and+any+other+relevant+terms+and+conditions%2C+policies+or+notices%2C+the+other+relevant+terms+and+conditions%2Cpolicies+or+notices+which+relate+specifically+to+a+particular+section+or+module+of+the+website+shall+prevail+in+respect+of+your+use+of+the+relevant+section+or+module+of+the+website.+%3Cbr%3E%3Cbr%3E%3Cb%3ESeverability%3C%2Fb%3E%3Cbr%3EAny+provision+of+any+relevant+terms+and+conditions%2C+policies+and+notices%2C+which+is+or+becomes+unenforceable+in+any+jurisdiction%2C+whether+due+to+being+void%2C+invalidity%2C+illegality%2C+unlawfulness+or+for+any+reason+whatever%2C+shall%2C+in+such+jurisdiction+only+and+only+to+the+extent+that+it+is+so+unenforceable%2Cbe+treated+as+void+and+the+remaining+provisions+of+any+relevant+terms+and+conditions%2C+policies+and+notices+shall+remain+in+full+force+and+effect.%3Cbr%3E%3Cbr%3E%3Cb%3EApplicable+Laws%3C%2Fb%3E%3Cbr%3EUse+of+this+website+shall+in+all+respects+be+governed+by+the+laws+of+the+state+of+Gujarat%2C+India%2C+regardless+of+the+laws+that+might+be+applicable+under+principles+of+conflicts+of+law.+The+parties+agree+that+the+courts+located+in+India+country%2C+Gujarat%2C+shall+have+exclusive+jurisdiction+over+all+controversies+arising+under+this+agreement+and+agree+that+venue+is+proper+in+those+courts.%3Cbr%3EAs+per+the+current+guidelines+mandated+by+the+Government+of+India%2C+a+customer+has+to+provide+the+Permanent+Account+Number+%28PAN%29+for+all+purchases+above+INR+2+Lakh.Contests%3Cul%3E%3Cli%3EThe+winners+of+contests+and+giveaways+will+be+selected+at+the+company%E2%80%99s+discretion.%3C%2Fli%3E%3Cli%3EThe+prizes%2Fgifts%2Fgiveaways+are+non-returnable%2Fexchangeable.%3C%2Fli%3E%3Cli%3EAny+additional+facilities+provided+by+the+company+to+winners+and+selectees+of+any+contest+are+at+the+company%E2%80%99s+discretion.%3C%2Fli%3E%3Cli%3EABC+%28ABC.COM%29+reserves+the+right+to+change+the+terms+and+conditions+of+contests%2Fgiveaways+without+prior+intimation.%3C%2Fli%3E%3Cli%3EAll+disputes+will+be+resolved+at+contactus%40domain.com%3C%2Fli%3E%3C%2Ful%3E%3Cb%3EFree+Gift%3C%2Fb%3E%3Cul%3E%3Cli%3EAll+free+gifts+are+treated+as+discounts%3C%2Fli%3E%3Cli%3EIn+Case+of+Partial+Cancellation+or+Returns+of+Orders+with+Free+gift%2C+the+amount+refunded+will+not+include+the+discount+attributed+to+the+Free+Gift%3C%2Fli%3E%3C%2Ful%3E%3Cb%3EOther+Conditions%3C%2Fb%3E%3Cul%3E%3Cli%3ESign+up+credits+cannot+be+used+for+purchase+of+gold+coins%3C%2Fli%3E%3C%2Ful%3E%3Cb%3EOffer+Terms+and+Conditions%3C%2Fb%3E%3Cul%3E%3Cli%3ESpecial+offer+is+valid+only+on+selected+designs+on+jewellery.%3C%2Fli%3E%3Cli%3EABC+Jeweller+may+change+%28add+to%2C+delete%2C+or+amend%29+these+terms+from+time+to+time.%3C%2Fli%3E%3Cli%3EAll+disputes%2C+with+respect+to+the+products+and+services+offered+in+the+connection%2C+are+subject+to+Vadodara+Jurisdiction%3C%2Fli%3E%3C%2Ful%3E%3C%2Fdiv%3E', 'Yes'),
(7, 'Buy Back Policy', '%3Ch3%3EBuy+Back+Policy%3C%2Fh3%3E%3Cul%3E%3Cli%3EPlain+gold+jewellery+is+eligible+for+buy+back+at+90%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+the+metal%29.%3C%2Fli%3E%3Cli%3EDiamond+with+gold+jewellery+is+eligible+for+buy+back+at+75%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+the+metal+and+total+carat+weight+of+the+diamonds%29.%3C%2Fli%3E%3Cli%3EGemstone+with+gold+jewellery+is+eligible+for+buy+back+at+65%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+the+metal+and+total+carat+weight+of+the+gemstones%29.%3C%2Fli%3E%3Cli%3EUncut+Diamonds%2C+Polki%2C+Kundan%2C+Cubic+Zirconia%28CZ%29+or+American+Diamonds+with+Gold+Jewellery+are+eligible+for+buy+back+at+90%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+metal+only%29.%3C%2Fli%3E%3Cli%3EGold+coins+are+eligible+for+buy+back+at+95%25+of+current+market+value+of+the+product.%3C%2Fli%3E%3Cli%3EWe+currently+do+not+accept+Loose+Solitaires+and+Tushi+Necklaces+under+buyback+policy.%3C%2Fli%3E%3Cli%3EShipping+charge+of+Rs.500+will+be+borne+by+the+customer+for+all+jewellery+under+this+policy.%3C%2Fli%3E%3Cli%3EThe+prevailing+market+value+will+be+determined+by+abc.com%3C%2Fli%3E%3Cli%3EMoney+back+shall+be+done+by+way+of+online+bank+transfer+to+the+customer%E2%80%99s+bank+account+within+10+days%2C+after+quality+check+and+valuation+is+confirmed+by+the+customer.%3C%2Fli%3E%3Cli%3EThis+feature+is+not+available+for+International+orders+%28Orders+that+will+be+shipped+abroad+from+India%29.%3C%2Fli%3E%3C%2Ful%3E', 'Yes'),
(8, 'Lifetime Exchange Policy', '%3Ch3%3ELifetime+Exchange+Policy%3C%2Fh3%3E%3Cul%3E%3Cli%3EIn+case+of+plain+gold+jewellery%2C+95%25+of+current+market+value+of+the+product+%28as+per+the+net+weight+of+metal%2C+can+be+used+to+purchase+any+jewellery+excluding+gold+coins.%3C%2Fli%3E%3Cli%3EIn+case+of+diamonds+with+gold+jewellery+or+diamond+with+platinum+jewellery%2C+80%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+the+metal+and+total+carat+weight+of+diamonds%29%2C+can+be+used+to+purchase+any+diamond+or+gemstone+jewellery%28excluding+gold+coins%29.%3C%2Fli%3E%3Cli%3EIn+case+of+gemstone+with+gold+jewellery%2C+70%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+the+metal+and+total+carat+weight+of+the+gemstones%29%2Ccan+be+used+to+purchase+any+diamond+or+gemstone+jewellery%28excluding+gold+coins%29.%3C%2Fli%3E%3Cli%3EIn+case+of+Tushi+Necklaces%2C+Uncut+Diamonds%2C+Polki%2C+Kundan%2C+Cubic+Zirconia%28CZ%29+or+American+Diamonds+with+Gold+Jewellery%2C+95%25+of+current+market+value+of+the+product+%28as+per+net+weight+of+metal+only%29%2C+can+be+used+to+purchase+any+jewellery%28excluding+gold+coins%29.%3C%2Fli%3E%3Cli%3EIn+case+of+gold+coins%2C+100%25+of+current+market+value+of+the+product%2C+can+be+used+to+purchase+diamond+or+gemstone+jewellery.%3C%2Fli%3E%3Cli%3ENo+return+or+exchange+policy+is+applicable+on+Loose+Solitaires.%3C%2Fli%3E%3Cli%3EShipping+charge+of+Rs.500+would+be+borne+by+the+customer+for+all+jewellery+falling+under+this+policy.%3C%2Fli%3E%3Cli%3EThe+prevailing+market+value+will+be+determined+by+abc.com%3C%2Fli%3E%3Cli%3EIn+case+the+value+of+the+new+product+is+higher+than+the+exchange+value+of+the+old+product+the+difference+will+be+paid+by+the+customer.+In+case+the+value+of+the+new+product+is+lesser+than+the+exchange+value+of+the+old+product+the+difference+will+be+held+as+credit+for+future+purchases.%3C%2Fli%3E%3Cli%3EThis+feature+is+not+available+for+International+orders+%28Orders+that+will+be+shipped+abroad+from+India%29.%3C%2Fli%3E%3C%2Ful%3E', 'Yes');
